INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("やばいですね☆なの！", "プリンセスなプリンなの\nお店にあったいろんな食べもの\nを入れられるだけ入れてみたの\nどんな味なのか楽しみなの", 3, "おいしすぎて食べ始めたら\n止まらない最高のプリンなの\n今のミヤコを止められるヤツは\n誰もいないの", 100, 1, "ペコリーヌのプリン", 1, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("主さま、なの！", "いつもオマエのそばに寄りそう\nヤツのぷりんなの。ミヤコの\nワガママもやさしく受け入れて\nくれそうなの", 3, "なんだかすごくやさしい気持ち\nになる味なの…\nおはようからおやすみまで\nずっと一緒な味なの…", 101, 1, "コッコロのプリン", 2, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("ぶっ殺すぞ！なの！\n…デレデレはどこなの？", "ツンツンデレデレなヤツの\nプリンなの。砂糖とスパイスを\n混ぜてみたの。どんな味になる\nか楽しみなの", 3, "いろんな味が一度で楽しめる\nプリンなの。ツンデレはプリン\nにするとおいしいの。ミヤコも\nツンデレを目指してみるの", 102, 0, "キャルのプリン", 3, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("おにーたん♪なの！", "オマエと同じで、一度赤ちゃん\nみたいになったヤツのプリン\nなの。ヒンヤリ、プリンアイス\nにしてみたの", 3, "あったかいところで食べる\nプリンアイスは最高なの～♪\n安心しすぎて昔の記憶のない\nミヤコも心が子どもになるの～", 103, 1, "シェフィのプリン", 4, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("ハーハッハッハ！\n世界征服なのじゃなのー！", "イリヤを見てたら思いついた\nトマトジュースが隠し味の\nプリンなの。栄養満点なの", 3, "トマトで栄養補給も完璧なの\nどんどん力がみなぎってきて\n復活も夢じゃないの\nミヤコが復活したら…", 104, 1, "イリヤのプリン", 5, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("お兄ちゃんのエッチ！　なの！", "アカリのプリンなの。ヨリと\n同じくらいかわいく作って\nやったの。正直ミヤコは\nおいしければなんでもいいの", 3, "見た目がかわいくてもミヤコは\n味にも厳しいの。あむっ…\nこ、これは…！なんだかすごく\n変な気分になってきたの…", 105, 1, "アカリのプリン", 6, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("えっと…その…あんたのこと…\nだ、大っ嫌いなのーー！", "かわいくつくらないとアカリが\n怒りそうだからヨリのプリンは\nかわいく作ったの。自信作なの", 3, "んむぅ…これはなかなか感想が\n難しいプリンなの…率直に言い\nたいような…心のうちに秘めて\nおきたいような…", 106, 1, "ヨリのプリン", 7, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("お父さん…\nいいかげんにしてなの！\nん？プリンの未来は…\n見えなかったの…", "シノブはいつもミヤコに\nやさしくしてくれるから\n丁寧に作ったの。ドクロ親父は\nいらないから作ってないの", 3, "このプリンを食べるとシノブが\nミヤコの中にいるみたいなの！\nシノブの力があれば未来の\nプリンを見放題なの！", 107, 0, "シノブのプリン", 8, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("インフェルノシールド！なの！", "黒い鎧を脱がないヤツのプリン\nなの。固めのプリンを目指したら\nカチカチになりすぎたの", 3, "固すぎてかじれないから丸吞み\nにしたの。なんだか体が硬く\nなった気がするの。みんなを\n守れる気がするの！", 108, 1, "ジュンのプリン", 9, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("あなたといると調子が狂うな\n…なの\n翻弄してたのはオマエなの？", "オマエをいっつもからかってる\nヤツのプリンなの\nちょっぴり変わったスパイスで\nからかいを表現したの", 3, "口の中でスパイスがプチプチ\nはじけて新食感なの！\nプチプチがミヤコを\n翻弄するの！", 109, 1, "トモのプリン", 10, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("タイガーヒーローボンバー！\nなの！", "王宮騎士団にいるちっこいヤツ\nなの。ちっこいけどやるヤツ\nらしいから、濃いめの味付けに\nしてみたの", 3, "ん～見かけによらず濃厚な\nパンチのある味わいが\n口いっぱいに広がるの！", 110, 1, "マツリのプリン", 11, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("ま、いいんじゃん？\nしらんけどなの", "なんかすごくクールなプリンなの\nなんかテンションも少し\n低そうなの。これ\n食べちゃっても大丈夫なの？", 3, "クールな見た目なのにとっても\n優しい味なの！なんだか\n懐かしさを感じるの…", 111, 1, "クロエのプリン", 13, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("ぷりーん★なの！", "きれいにデコれたの！\nカラフルでおいしそうなの\nこれは期待できそうなの", 3, "なんか変わった食感なの…\nちゃる…ちょる…ちぇる？\nちぇるってしてるの\nでもちぇるってなんなの？", 112, 1, "チエルのプリン", 14, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("端的に換言すれば\n青春の味なの？", "見た目は完ぺきなの！\nこれをつくったやつは\nきっと天才なの！\n早く食べたいの！", 3, "味はなんか妙に\n甘酸っぱいの…\n食べたことない味なの\nこの味ってもしかして…", 113, 1, "ユニのプリン", 15, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("幼なじみはあんた…なの？", "オマエから聞いた懐かしい\n味ってヤツを全部入れてみたの\nオマエ記憶がないのに懐かしい\nってどういうことなの？", 3, "ミヤコも幽霊になる前の記憶\nがないのに、なんだか懐かしい\n気持ちになってくるの…", 114, 1, "サレンのプリン", 16, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("ひゃああんなの～！", "たまたま会ったメイドに教えて\nもらった作り方なの。メイドは\nプリンも作れるはずなの。\nなのにこの不安は何なの…？", 3, "おかしいの。このプリンを\n食べてから、３回も転んだの\nミヤコは幽霊だから転んだり\nしないの。なんでなの…？", 115, 1, "スズメのプリン", 17, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("サルキデバレヤ！なの！", "怖がりな子どもが教えてくれた\n小さくてかわいいプリンなの　\n触ってないのにぷるぷる震える\n驚きのやわらかさなの", 3, "甘さのなかに少しのしょっぱさ\nクセになる味なの\nこのプリンはがんばればきっと\nいろんな美味しいになれるの", 116, 0, "クルミのプリン", 18, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("プリンフルスイングなの～！", "くまのぬいぐるみを見ていたら\nひらめいたの。小さいけど\nしっかりした甘さの元気に\nなれるプリンなの！", 3, "このプリン、食べるとなんだか\nお姉ちゃんになった気分に\nなるの。ピンチのプリンは\nミヤコが守ってやるの！", 117, 1, "アヤネのプリン", 19, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("みらくるみやりん\nくるりんぱ～☆なの！", "マホマホ王国って国にいる\nお姫様のプリンなの\n魔物も虜にしちゃう\nすてきなプリンなの", 3, "メルヘンパワーがあふれてきて\nいまならミヤコにも魔法が\n使える気がするの！\nほな、いきまひょ～なの！", 118, 1, "マホのプリン", 20, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("ウルフェンバイトなの！", "カッコいいプリンを目指して\nワイルドなものをガンガン\n入れてみたの。きっと熱い\nプリンができるはずなの", 3, "うおーん！ミヤコなんだか\n強くなった気がするの！\n困ったことがあればミヤコが\nまとめて面倒見てやるの！", 119, 1, "マコトのプリン", 21, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("なんくるないさ～！なの！", "どっかの国でよくとれる\nゴーヤーに似てるやつを\nいれてみたの！ちょっと\n苦いらしいけど…", 3, "一口食べたら元気が\nあふれて止まらないの！\n気分がいいから、一曲\n踊りでも披露してやるの！", 120, 1, "カオリのプリン", 22, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("ふふん。簡単な推理なの", "勘の鋭いやつが好きな食べ物を\nたくさん入れてみたの\n難しいこと考えるのにぴったり\nらしいけど、なんでなの？", 3, "むむむ…なるほどなの\n上質な糖分をふんだんに\n使うことで、脳をより活性化\nできるからなの！", 121, 1, "カスミのプリン", 23, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("エリザベス～！なの～！", "搾りたての牛乳を\nたっぷり使ったプリンなの～\nマヒルに手伝ってもらって\nミヤコ直々に搾ってきたの！", 3, "ミルクがとっても濃厚で\nほっぺたが落ちちゃうの～♪\nこのプリンからは牧場の…\n自然の息吹を感じるの！", 122, 1, "マヒルのプリン", 24, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("私の好きな本…読んで\nもらえたらうれしいです…\nなの", "マヒルからやさしいヤツだって\n聞いたの。やさしさを表現\nするために奥ゆかしい甘さに\n仕上げてみたの", 3, "ほのかな甘さでありながら\nしっかりとした主張も\n感じさせる\n味わい深いプリンなの", 123, 1, "シオリのプリン", 25, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("もふもふにしてあげるなの！", "牧場にいるヤツらしいの\n牛とは違うらしいの\nもふもふ気持ちいいらしいから\n食感にこだわって作ったの", 3, "こ、これは…！口の中に入れた\n瞬間にふんわり溶けて\nなくなっちゃうの！\nその食感がやみつきなの！", 124, 1, "リマのプリン", 26, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("めんどくさいな～なの…", "いっつも寝てるやつらしいの\nぐっすり眠れる薬草をたくさん\n入れてみたの。プリンとして\nおいしくなるかはわからないの", 3, "んむぅ…評価が難しい味なの…\nおいしいのはおいしいの…\nん～考えてたら…\n眠くなってきたの…", 125, 0, "リンのプリン", 27, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("プリンの権能を解放するの～！", "クレープ屋の真っ赤な人に\n教わったプリンなの\n作り方を丁寧に教えてくれて\nとっても優しい人だったの！", 3, "プ…プリンなのにクレープの味\nがするの。味もすごく普通なの\nでも…なんだかプリンの新しい\n扉を開けそうな気がするの…！", 126, 1, "ラビリスタのプリン", 28, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("お姉ちゃんパワー全開！なの！", "お店に落ちてた謎のレシピの\nプリンなの。レシピの表紙には\n『お姉ちゃんの愛情たっぷり』\nって書いてあったの", 3, "とろける食感が絶品なの～♪\n食べるとなんだか幸せな\n気持ちになれるの…これが\n愛情ってやつなの？", 127, 0, "シズルのプリン", 29, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("お兄ちゃん、プリンをよこすの！", "リノから作り方を教わったの！\nさすがクレープ屋で働いてる\nだけあって美味しそうなの！", 3, "これで妹力？があがるらしいの。\n妹になればお兄ちゃんに\nプリンをたかり放題なの！\n最高なの～！", 128, 1, "リノのプリン", 30, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("困った時はお互いさまさま！\nなの！", "プリンのレシピで悩んでたら\n通りすがりのおねーさんが\n一緒に考えてくれたプリンなの\nいいヤツもたまにはいるの～♪", 3, "食べたら元気が湧いてくるの\nだからプリンのレシピのお礼に\nミヤコも人助けを手伝って\nやったの。ミヤコはえらいの！", 129, 1, "ヒヨリのプリン", 31, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("フラワリングヒールなの～♪", "ミヤコががんばって作った\nこだわりのプリンなの～\nプリンは癒しなの。だから優しい\n気持ちで丁寧に作ったの", 3, "はっ…思わずお花畑が見えたの\n身も心も包まれるような\nとっても優しい味がするの\nこれは…まさに癒しなの～♪", 130, 1, "ユイのプリン", 32, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("スラッシュテンペスト！なの。", "究極のプリンを作るため\nミヤコは厳しい修行をしたの…\nその結果あって完成した\nクールで完璧なプリンなの！", 3, "確かに完璧なプリンなの\nでも究極のプリンと呼ぶには\nまだまだ修行が必要なの…\nプリン作りは奥が深いの…！", 131, 1, "レイのプリン", 33, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("おーほっほほほ！なの！", "豪華で高級な\nお嬢様プリンなの\n中には宝石みたいな\n大きいイチゴを入れるの！", 3, "味にも素材にもこだわりが\nあるの。一流は妥協しないの\nもっと豪華に、もっとおいしく\nできるはず…", 132, 1, "アキノのプリン", 34, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("プリしゅわ最高～！なの！", "外はしっかり、中はふわとろの\nプリンにするの\n泡みたいなしゅわしゅわの\n生クリームも入れるの♪", 3, "プリンは飲み物とも言うの\nぐいっていってみるの\n…ふわしゅわでとろけるの～！\n体に染みわたるの～", 133, 1, "ユカリのプリン", 35, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("にゃにゃにゃ！なの！", "餡子を入れて\nオーブンでこんがり焼くの\nたい…焼きプリンなの\n斬新なの！", 3, "このプリンは焼きたてのうちに\n食べるのが一番なの…！\n熱いけどおいしくて\nうずうずしてきたの…！", 134, 1, "タマキのプリン", 36, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("効率全開！なの！", "栄養バランスを考えて\n木の実をたくさん入れるの\nあれこれ忙しいときでも\n頼りになるプリンなの！", 3, "プリンはいつでも手軽に\n食べられるのも魅力なの\nこれは食べ応えもあるから一つ\n食べればいっぱい動けるの", 135, 0, "ミフユのプリン", 37, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("あらあら～なの～♪", "エルフの森で子どもにもらった\n薬草を使って作ったの\nこんな優しい味のプリンは\n初めてなの…", 3, "このプリンを食べてから\nいい子になった気がするの\n大好きなプリンを泣いてる子に\nあげたの。いい気分なの", 136, 1, "ミサトのプリン", 38, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("スヤスヤ～…なの…", "お昼寝でみた夢の中に\nでてきた不思議なプリンを\n作ってみたの。見てたらまた\n眠くなってきたの…", 3, "あまいプリンが口の中で\nぽんぽん弾ける未知の味なの！\n今なら不思議な力で世界も\n救えそうなの！でも眠くなるの…", 137, 1, "ハツネのプリン", 39, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("ぼっちは卒業なの～！", "お店のはしっこに一つだけ\n残ったおもちゃを見て思い\nついたの。他のプリンと一緒に\n置いておくと震えだすの", 3, "知らないうちにはしっこに\n隠れちゃってたの。食べたら\nミヤコ、シノブたちに会いに\nいきたくなってきたの", 138, 1, "アオイのプリン", 40, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("リズムあげるのー！", "トップオブアイドルの\nプリンなの。キラキラした\nものを入れて、あつ～い\nオーブンで焼いてみたの", 3, "口の中に華やかな甘さが\n広がる…これがアイドルなの？\n急に歌って踊りたく\nなってきたの！", 139, 1, "ノゾミのプリン", 41, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("風の加護を！なの！", "ミヤコにプリンをくれるすごく\nいいヤツのプリンなの\n精霊に呼びかけながら\n一生懸命かき混ぜたの", 3, "プリンの生地がとっても\nなめらかで最高の舌触りなの！\n精霊、ミヤコのプリンのために…", 140, 1, "チカのプリン", 42, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("騎士さんのために\nしたんじゃありません！なの！", "歌って踊って衣装も作れるヤツ\nのプリンなの。このプリンは\nきれいに包装するの。プリンを\n最高の形で着飾らせるの", 3, "包装は食べるまでの手間が\n増えてめんどくさいの。でも\nそのめんどくささもプリンの\n味を引き立てるの", 141, 1, "ツムギのプリン", 43, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("宴の始まりなの！", "プリンをくれないならどうでも\nいいヤツなの。でも横で\nいろいろ言ってきたから\nがんばって作ったの", 3, "んむっ！？\nく、口のなかでプリンの\nおいしさが大暴れなの！\n止まらないの！", 142, 0, "クリスティーナのプリン", 12, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("一刀両断、覚悟しな！なの！", "大人な甘さ控えめのプリンを\n作るの。試しにお魚を入れて\nみるの。プリンの可能性は\n無限大なの！", 3, "大人の味なの。今やミヤコは\nみんなの頼れる姐御なの！\n悪さするやつはミヤコが\n許さないの！", 143, 1, "ルカのプリン", 44, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("きゅぴーん！キタコレ！なの！", "サイカワサイツヨな\n魔法のプリンなの\n中身をカラフルにするの～\n甘いプリンは頭が冴えるの！", 3, "一口食べる度に味が変わって\n魔法みたいなの！\nもしかして全部食べたら\nミヤコも魔法少女になれるの？", 144, 1, "ナナカのプリン", 45, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("人呼んで、疾風のミヤコなの！", "小難しい言葉をささやきながら\n作ったら魔力あふれるプリンが\n爆誕したの！でも、不思議と\nイタイタしいのはなぜなの～？", 3, "一口食べたら謎の組織に\n狙われたり、前世の記憶が蘇る\n気がするの～設定盛りすぎなの\nミヤコは、ミヤコは…", 145, 1, "アンナのプリン", 46, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("クスクス…クスクスクス…なの", "甘酸っぱい赤い木の実を\n切り刻んで入れるの\n甘くてちょっぴり刺激的な\nヤンデレのプリンなの", 3, "なんか普通のプリンよりも\nいい匂いがするの～…\nプリンのことがもっともっと\n好きになっちゃうの…", 146, 1, "エリコのプリン", 47, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("どんなプリンも\nミヤコの隻眼からは\n逃れられないの～！", "健康に気を遣うミヤコは\nプリンにお薬を入れてみたの～\nでもなんだか毒々しいから\n彩りにバラを添えてみたの～", 3, "鼻に抜ける薬のにおいがアレ\nだけど大人っぽくて頭が\nよくなった気がするの。無性に\n実験したくてしかたないの", 147, 1, "ミツキのプリン", 48, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("私は子どもではない！なの！", "小さいけどしっかりした\n軍人のプリンなの\nちょっと固めにして\n砂糖はいっぱい入れるの", 3, "ん～王道なプリンは\n甘くて安定したおいしさなの～\n思わず笑顔になっちゃうの\nにこにこなの～♪…はっ！", 148, 1, "モニカのプリン", 49, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("ショーグン！　ミヤコと一緒に\n天下統一するデースなの！", "オーエド町で手に入れた素材と\nトーゴクに伝わる術をかけて\nプリンを作るの。シュババ！\n忍法隠し味の術なの！", 3, "このプリンを食べてから\n誰かにお仕えしなきゃ\nいけない気がするデースなの\nそれはショ、ショー…", 149, 1, "ニノンのプリン", 50, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("…ぐふふ、じゅるり～なの", "オマエが持ってきた手錠を\nヒントに作ったプリンなの\nプリンが動けないように\nカチカチに固めたの", 3, "カチカチに固めたせいで食感が\nプリンのようで\nプリンじゃないの…でもこの\nもどかしさが癖になるの…", 150, 0, "クウカのプリン", 51, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("あぁ、ミヤコはなんて美しいの～", "とっても美しいプリンなの\n美しいものを手当たり次第\n入れたらすごいことになったの", 3, "味も美しい以外の感想が\n出てこないの。ていうかこれを\n食べたミヤコも美しいの！\n鏡、鏡はどこなの！", 151, 1, "ユキのプリン", 52, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("ジー…ってミヤコなにしてるの\nミヤコはストーカーじゃないの！", "知らないうちにお菓子が売れた\n時に思いついたプリンなの。\n作り方もよく覚えてない…\nけど、きっとおいしいの！", 3, "うん、やっぱりおいしく…\nん？あそこにいるのは\nアイツなの。あれ？\n体が勝手にアイツの方に…", 152, 0, "アユミのプリン", 53, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("にひひ…イタズラの時間なの！", "イタズラ好きの手下と一緒に\n作ったプリンなの。見た目は\nかわいいけど、作り方は\n意外と複雑なの～", 3, "見た目通り甘々で優しい味なの\nでも、レシピを見たら裏面に\n別の作り方が書いてあるの。\nこれだと激辛プリンに…", 153, 0, "ミソギのプリン", 54, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("ぴょんぴょこぴょーん、なの♪", "素直でやさしい手下と一緒に\n動物のぬいぐるみをいっぱい\n並べて作ったの", 3, "ん～、ふわふわの甘々なの！\nなんだか楽しくなって\n心も体もるんたったしてくるの", 154, 0, "ミミのプリン", 55, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("へんたいふしんしゃさんなの！", "幽霊を怖がっている手下と\n一緒に作ったプリンなの。\n小さいクセにきっちりしてて\nとってもかわいいプリンなの", 3, "ひんやりしてて暑い日でも\nおいしく食べられそうなの！\nん？これを買いたい大人が\nいる？それって…", 155, 0, "キョウカのプリン", 56, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("ハート狙い撃ち！なの！", "カリスマモデルなプリンなの\nモリモリにデコレーションして\nカリスマ感を演出したの", 3, "見て食べて楽しめる新機軸の\nプリンなの。ミヤコは幽霊\nだけど自分の足でランウェイを\n歩きたくなってきたの！", 156, 1, "スズナのプリン", 57, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("授業を始めます♪なの！", "学校の先生をしてるヤツの\nプリンなの。お堅くしようと\nしたら、いつの間にか色っぽく\nなっちゃったの。なんでなの？", 3, "プ、プリンは全部ミヤコのもの\nなのに、なんだかこのプリンは\nいろんな人に教えたく\nなっちゃう不思議な味なの！", 157, 0, "イオのプリン", 58, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("立派なレディ、なの！", "少し背伸びしたおませな子を\n表現したプリンなの。あえて\n甘さ控えめなの。カラメルは\n後乗せできるから安心するの", 3, "ミヤコはプリンならどんなもの\nでも食べるの。でもカラメルを\nちょっとだけ足すの。\nちょっとだけなら…", 158, 1, "ミサキのプリン", 59, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("プリンを持ってこないと\nお仕置きだよ～☆なの！", "謎に包まれたプリンができたの\n何か隠してるようなの…\nこれは危険なプリンなの！", 3, "味はすごいゴージャスなの！\nボスの風格があるの！\nビッグなミヤコに\nプリンを捧げるの！", 159, 1, "ホマレのプリン", 60, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("たぎってきたの！", "ワイルドな見た目なの！\nこれは期待できそうなの。\nきっと躍動感あふれる味なの！", 3, "最初の一口目が\nすごいインパクトなの！\n無性にケンカしたくなるの！\nプリンをよこせなの！", 160, 1, "カヤのプリン", 61, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("下剋上、やってやるですなの！", "なんか見た目がパッとしないの\nこれほんとに大丈夫なの？\nなんか頼りないの…", 3, "見た目はアレだけど味はおいし\nいの…あと主張もはっきりして\nるの！やる気と自信だけは\n出てきたのうおおおーなの！", 161, 0, "イノリのプリン", 62, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("どけどけ～！なの～！", "天下の大悪党のプリンなの\nこれまでのジョーシキに\n捉われないプリンを\n作ってみたの～", 3, "むむむ…食べたら\nやる気が湧いてきたの！\nミヤコを邪魔するやつはみんな\nまとめてぶっ飛ばしてやるの～", 162, 1, "ムイミのプリン", 63, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("ミラーミラー！なの！", "いろんなものに変身したり\n分身したりできるヤツの\nプリンなの。型で同じプリンを\nたくさんたくさん作ったの", 3, "いつのまにか作ったの全部\n食べちゃったの。なんで\nプリンは分身しないの？\n無限に増えろなの！", 163, 1, "ネネカのプリン", 64, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("プリンに忠誠を誓いますわ！\nなの！", "金の亡者のプリンなの\n金にものを言わせて作って\nみたの。おばあちゃんの\nプリンと対極なの", 3, "むぅ…認めたくないけど\nおいしいの…これを何個も\n作れるほどのお金を稼ぐのは\n大変なの…でもおいしいから…", 164, 1, "クレジッタのプリン", 65, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("ギルド管理協会へようこそ！\nなの！", "みんなお世話になるギルド\n管理協会職員のプリンなの\nお役所感を出すために手堅く\n王道に作ったの", 3, "手堅い…！手堅いの…！\n隙のないプリンなの！\n今のミヤコなら完璧な\n書類作成ができそうなの！", 165, 1, "カリンのプリン", 66, 5);
